import React, { Component } from 'react';
import classes from './ServiceCard.module.css';
import Ionicon from 'react-ionicons';
// import {Link} from 'react-router-dom';

class ServiceCard extends Component{

    state={
        display: false,
    }

    toggleDisplayHandler = () => {
        const disp = !this.state.display;
        this.setState({display:disp});
    }

    render(){

        const list = this.props.services.map((service,index) => {
            return (<li key={index}><a href="/">{service}</a></li>);
        })

        let displayClass = classes.Display;
        if(this.state.display){
            displayClass = classes.Display;
        }

        return (
            <div className={classes.ServiceCard}>
                <div className={classes.Heading}>
                    <div>{this.props.title}</div>
                    <Ionicon icon="ios-arrow-dropdown" fontSize="35px" color="#f5f5f0"/>
                </div>       
                <ul className={displayClass}>
                    {list}
                </ul>
            </div>
        );
    }

}

export default ServiceCard;
